import styled from "styled-components";
import { WHITE } from "../../../public/color";

export const TableContainer = styled.article`
  display: flex;
  flex-direction: column;
  width: 100%;
  min-height: 860px;
  background-color: ${WHITE};
  border-radius: 20px;
  padding: 2rem 0;
`;
